import React, { Component } from 'react'
import './index.css'

export default class Demo extends Component {
    render() {
        return (
            <div className="a">
                我是主组件
                
            </div>
        )
    }
}

class B extends Component {
    render () {
        return (
            <div className="b">
                <h1>我是B组件</h1>
            </div>
        )
    }
}

class C extends Component {
    render () {
        return (
            <div className="c">
                <h1>我是C组件</h1>
            </div>
        )
    }
}
